import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { Web3Provider } from './context/Web3Context';

// Pages
import Dashboard from './pages/Dashboard';
import DocumentGenerator from './pages/DocumentGenerator';
import ContractReviewer from './pages/ContractReviewer';
import DAOCreator from './pages/DAOCreator';
import LegalChatbot from './pages/LegalChatbot';
import Login from './pages/Login';
import Register from './pages/Register';

// Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import PrivateRoute from './components/PrivateRoute';

function App() {
  return (
    <AuthProvider>
      <Web3Provider>
        <Router>
          <div className="flex flex-col min-h-screen">
            <Navbar />
            <main className="flex-grow">
              <Routes>
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/dashboard" element={
                  <PrivateRoute>
                    <Dashboard />
                  </PrivateRoute>
                } />
                <Route path="/document-generator" element={
                  <PrivateRoute>
                    <DocumentGenerator />
                  </PrivateRoute>
                } />
                <Route path="/contract-reviewer" element={
                  <PrivateRoute>
                    <ContractReviewer />
                  </PrivateRoute>
                } />
                <Route path="/dao-creator" element={
                  <PrivateRoute>
                    <DAOCreator />
                  </PrivateRoute>
                } />
                <Route path="/legal-chatbot" element={
                  <PrivateRoute>
                    <LegalChatbot />
                  </PrivateRoute>
                } />
                <Route path="/" element={<Navigate to="/dashboard" replace />} />
              </Routes>
            </main>
            <Footer />
          </div>
        </Router>
      </Web3Provider>
    </AuthProvider>
  );
}

export default App;
